import React from "react";

const Header = () => {
  return (
    <header>
      <img src="./images/logo/logo.jng" alt="Logo" />
      <ul>
        <li>Home</li>
        <li>Reservation</li>
        <li>Menu</li>
        <li>About</li>
        <li>Contact</li>
        <li>Meet The Chefs</li>
      </ul>
      <ul>
        <li>font 1</li>
        <li>font 2</li>
        <li>font 3</li>
      </ul>
    </header>
  );
};

export default Header;
